import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Dashboard() {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState(null);
  const [showOtherDetails, setShowOtherDetails] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/'); // Redirect to login if not logged in
      return;
    }

    const fetchData = async () => {
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setCommissionData(result.commissionData);
        setViolationsData(result.violationsData);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  if (!commissionData || !violationsData) return <div>Loading...</div>;

  const mainFields = [
    { key: "agentname", label: "Agent Name" },
    { key: "region", label: "Region" },
    { key: "nbrwbf", label: "NB BF" },
    { key: "enfees", label: "Endo Fees" },
    { key: "totalnben", label: "NB+EN Total" },
  ];

  const expensesFields = [
    { key: "totalnbs", label: "Total NBs" },
    { key: "grosspay", label: "Gross Pay" },
    { key: "nbcorffee", label: "NB Corp Fees" },
    { key: "encorpfee", label: "Endo Corp Fees" },
    { key: "refferalspayout", label: "Referrals/Pay Out" },
  ];

  const additionalFields = [
    { key: "nben(afterfees)", label: "Total Rev After Fees *" },
    { key: "reissuerenewaltotal", label: "Reinstatement and Renewal Fees" },
    { key: "bonustier", label: "Bonus Tier" },
    { key: "totalbonus", label: "Bonus" },
    { key: "totalviolations", label: "Total Violations" },
    { key: "commissionafterarfeescanningviolations", label: "Total Commission" },
  ];

  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
        <h1>Agent Dashboard</h1>
        <button onClick={handleLogout} style={{ padding: "5px 10px", cursor: "pointer" }}>Logout</button>
      </div>

      <h2 style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", borderRadius: "5px" }}>üìù Weekly Commission</h2>
      <div style={{ backgroundColor: "#fff", padding: "10px", borderRadius: "5px", marginBottom: "10px" }}>
        {mainFields.map(field => (
          <div key={field.key} style={{ marginBottom: "4px" }}>
            <strong>{field.label}:</strong> {commissionData[field.key] || "N/A"}
          </div>
        ))}

        <h3 style={{ marginTop: "10px", color: "#d32f2f" }}>Expenses</h3>
        {expensesFields.map(field => (
          <div key={field.key} style={{ marginBottom: "4px" }}>
            <strong>{field.label}:</strong> {commissionData[field.key] || "N/A"}
          </div>
        ))}

        <div style={{ marginTop: "10px", marginBottom: "10px" }}>
          {additionalFields.map(field => (
            <div key={field.key} style={{ marginBottom: "4px" }}>
              <strong>{field.label}:</strong> {commissionData[field.key] || "N/A"}
            </div>
          ))}
          <small style={{ color: "gray" }}>* must be $500 or more to qualify for COMMISSION.</small>
        </div>

        <button
          onClick={() => setShowOtherDetails(!showOtherDetails)}
          style={{ backgroundColor: "#d32f2f", color: "#fff", border: "none", padding: "5px 10px", cursor: "pointer", borderRadius: "3px" }}
        >
          {showOtherDetails ? "Hide Other Details" : "Show Other Details"}
        </button>

        {showOtherDetails && (
          <div style={{ marginTop: "10px", backgroundColor: "#f9f9f9", padding: "10px", borderRadius: "5px" }}>
            {Object.entries(commissionData).map(([key, value]) => {
              if (
                mainFields.some(f => f.key === key) ||
                expensesFields.some(f => f.key === key) ||
                additionalFields.some(f => f.key === key)
              ) {
                return null;
              }
              return (
                <div key={key} style={{ marginBottom: "4px" }}>
                  <strong>{key}:</strong> {value || "N/A"}
                </div>
              );
            })}
          </div>
        )}
      </div>

      <h2 style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", borderRadius: "5px" }}>‚ö†Ô∏è Scanning Violations & ARs</h2>
      <div style={{ backgroundColor: "#fff", padding: "10px", borderRadius: "5px" }}>
        {violationsData.length > 0 ? (
          violationsData.map((violation, idx) => (
            <div key={idx} style={{ marginBottom: "10px" }}>
              {Object.entries(violation).map(([key, value]) => (
                <div key={key}>
                  <strong>{key}:</strong> {value || "N/A"}
                </div>
              ))}
            </div>
          ))
        ) : (
          <p>No violations found.</p>
        )}
      </div>
    </div>
  );
}

export default Dashboard;
